DELIMITER $$
CREATE TRIGGER `stockbase` AFTER INSERT ON `producto` FOR EACH ROW IF NEW.id_categoria=4 THEN
    	INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'38');
        INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'40');
        INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'42');
        INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'44');
    ELSEIF NEW.id_categoria=5 THEN
    	INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'UNICO');
    ELSE
    	INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'S');
        INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'M');
        INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'L');
        INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'XL');
    END IF
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `stockelim` AFTER DELETE ON `producto` FOR EACH ROW DELETE FROM stock WHERE id_producto = OLD.id
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `stockupdate` AFTER UPDATE ON `producto` FOR EACH ROW BEGIN
	IF NEW.id_categoria != OLD.id_categoria THEN
    	DELETE FROM stock WHERE stock.id_producto = OLD.id;
        IF NEW.id_categoria=4 THEN
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'38');
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'40');
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'42');
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'44');
            ELSEIF NEW.id_categoria=5 THEN
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'UNICO');
            ELSE
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'S');
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'M');
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'L');
                INSERT INTO stock (id_producto,talle) VALUES (NEW.id,'XL');
         end if;
     end if;
END
$$
DELIMITER ;

